import "./header.css";
import Like from "./";
function Header() {
  return (
    <div className="header__preview">
      <h1>DOM1STORE</h1>
      <div className="header__contact">
        <p>Бесплатно по УК</p>
        <p>+38 (067) 432-43 </p>
      </div>
      <div className="header__search">
        <input />
      </div>
      <div className="header__work">
        <button>
          <img src="./image/shop.png" />
        </button>
        <button>s</button>
        <button>s</button>
      </div>
    </div>
  );
}

export default Header;
